class Nav extends Component{
    constructor(props){
        super(props);
        this.state = {
            isClicked : false
        }
        this.handleClick = this.handleClick.bind(this.handleClick)
    }
    handleClick(props){
        this.props?console.log(props):console.log(props);
    }
    render(){
        return(
            <header>
                <div className="flex-nav">
                    <div className="flex-nav-right" style={{fontSize:32}}>CNPM</div>
                    <div className="flex-nav-left">
                        <button 
                        onClick={this.handleClick}
                        id="log-btn" 
                        style={{color:'white',backgroundColor:'transparent',border:'none'}}>LOG IN
                        </button>
                    </div>
                </div>
            </header>
        )
    }
}
export default Nav;
